import React from "react";

class Ordering extends React.Component{

  render() {
    return (
      <div class="ordering mt-10">
        <h4>Ordering</h4>
        <span class="help-block" id="helpBlock">Choose which order the funds are displayed on the page</span>
          <div id="simpleList" class="list-group">
            <div class="list-group-item" id="orderingOption1">Option 1</div>
            <div class="list-group-item" id="orderingOption2">Option 2</div>
            <div class="list-group-item" id="orderingOption3">Option 3</div>
          </div>
      </div>
    )
  }
}

export default Ordering;
